// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/Login'; // Assurez-vous que le chemin vers Login est correct
import HomePage from './components/HomePage'; // Assurez-vous que le chemin vers HomePage est correct

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/login">
                    <Login />
                </Route>
                <Route path="/" exact>
                    <HomePage />
                </Route>
            </Switch>
        </Router>
    );
}

export default App;
